// icons
import { MagnifyingGlassIcon, UserIcon, ShoppingCartIcon } from '@heroicons/react/24/outline';

export default function Navbar() {
     return(
          <div className='h-[75px] w-screen px-20'>
               <div className='flex justify-between items-center'>
                    <div>
                         <span className='font-bold text-3xl'>BestShop</span>
                    </div>
                    <div className='flex gap-x-3'>
                         <MagnifyingGlassIcon className='w-8' />
                         <div className='w-[2px] h-8 bg-gray-700'></div>
                         <UserIcon className='w-8' />
                         <div className='w-[2px] h-8 bg-gray-700'></div>
                         <ShoppingCartIcon className='w-8' />
                    </div>
               </div>
          </div>
     );
}
